class App extends Component {

  render() {


    return (


      // Uppercase is for component & Lowercase is for elemnts 

      <div className="App">

      <Navigation appTitle = {this.props.title}/>
       <Banner/>
       { this.props.information.map(el => <Column title={el.title} information={el.desc} />)}


      </div>
    )
  }
}


export default App
